import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { mockServices, mockAppointments, mockUser } from '../../mockData';
import '../styles/Dashboard.css';

/**
 * Dashboard Component - Main page after login
 * 
 * Learning Goals:
 * 1. Displaying lists using map() function
 * 2. Conditional rendering
 * 3. Navigation between components
 * 4. Working with mock data
 * 
 * Why map()?
 * - Transforms array of data into array of JSX elements
 * - Renders lists efficiently
 * - Each item needs unique 'key' prop for React
 */

function Dashboard() {
  const navigate = useNavigate();
  const [searchTerm, setSearchTerm] = useState('');

  // Filter services based on search
  const filteredServices = mockServices.filter(service => 
    service.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
    service.type.toLowerCase().includes(searchTerm.toLowerCase())
  );

  /**
   * Handle booking navigation
   * When user clicks "Book Now", go to booking form with service details
   * 
   * In Phase 3, we'll pass this as route parameter
   */
  const handleBookNow = (service) => {
    navigate('/booking', { state: { selectedService: service } });
  };

  return (
    <div className="dashboard-container">
      {/* Header */}
      <div className="dashboard-header">
        <h1>üëã Welcome, {mockUser.name}!</h1>
        <p>Book your next appointment</p>
      </div>

      {/* Search Bar */}
      <div className="search-section">
        <input
          type="text"
          placeholder="Search for doctors, services..."
          className="search-input"
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
        />
      </div>

      {/* Quick Actions */}
      <div className="quick-actions">
        <button className="action-btn" onClick={() => navigate('/my-appointments')}>
          üìÖ My Appointments ({mockAppointments.length})
        </button>
        <button className="action-btn" onClick={() => navigate('/profile')}>
          üë§ My Profile
        </button>
      </div>

      {/* Services List */}
      <div className="services-section">
        <h2>Available Services</h2>
        
        {filteredServices.length === 0 ? (
          <p className="no-results">No services found matching your search.</p>
        ) : (
          // map() - Transform array of services into array of JSX cards
          <div className="services-grid">
            {filteredServices.map((service) => (
              <div key={service.id} className="service-card">
                {/* Service Header with Icon */}
                <div className="service-icon">{service.image}</div>
                
                {/* Service Info */}
                <h3>{service.name}</h3>
                <p className="service-type">{service.type}</p>
                
                {/* Details */}
                <div className="service-details">
                  <p>üí∞ ‚Çπ{service.price}</p>
                  <p>‚è±Ô∏è {service.duration} mins</p>
                  <p>‚≠ê {service.experience}</p>
                </div>
                
                <p className="service-description">{service.description}</p>
                
                {/* Book Now Button */}
                <button 
                  className="book-btn"
                  onClick={() => handleBookNow(service)}
                >
                  Book Now ‚Üí
                </button>
              </div>
            ))}
          </div>
        )}
      </div>

      {/* Info Section */}
      <div className="info-section">
        <h3>‚ÑπÔ∏è How it works?</h3>
        <ol>
          <li><strong>Browse Services:</strong> View all available doctors and services</li>
          <li><strong>Select Date & Time:</strong> Choose convenient time slots</li>
          <li><strong>Confirm Booking:</strong> Complete your appointment booking</li>
          <li><strong>Receive Confirmation:</strong> Get email and SMS confirmation</li>
        </ol>
      </div>
    </div>
  );
}

export default Dashboard;
